const Header = (props) => {
  return (
    <h1>
      {props.course}
    </h1>
  )
}

const Content = (props) => {
  return (
    <p>
      {props.name} {props.exercises}
    </p>
  )
}

const Total = (p1, p2, p3) => {
  console.log(p1)
  console.log(p2)
  console.log(p3)
  return p1 + p2 + p3
}

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  const Result = Total(parts[0].exercises, parts[1].exercises, parts[2].exercises)
  console.log(Result)

  return (
    <div>
      <Header course={course} />
      <Content name={parts[0].name} exercises={parts[0].exercises} />
      <Content name={parts[1].name} exercises={parts[1].exercises} />
      <Content name={parts[2].name} exercises={parts[2].exercises} />
      Total Number of Exercises + {Result}
    </div>
  )
}

export default App
